import React, { useEffect, useState} from 'react'
import ReactDOM from 'react-dom'
import { Parallax, ParallaxLayer } from 'react-spring/addons'
import HomeComponent from './HomeComponent/Home'
import AboutComponent from './AboutComponent/About'
import ContactComponent from './ContactComponent/Contact'
import JoinComponent from './JoinComponent/Join'
import Img from './res/dump-truck.svg'
import bg from './res/saaranglogo/1x/bg-100.jpg'
import cam from './res/saaranglogo/camera.svg'



class App extends React.Component {
  render() {
    return (

      <Parallax ref={(ref) => (this.parallax = ref)} pages={4}>

        <ParallaxLayer offset={1} speed={1} style={{ backgroundColor: '#805A58' }} />
        <ParallaxLayer offset={2} speed={1} style={{ backgroundColor: '#87BCDE' }} />
        <ParallaxLayer offset={3} speed={1} syle={{ backgroundColor: '#ffffff' }} />
        <ParallaxLayer offset={0} speed={1} factor={3} style={{ backgroundImage:  `URL(${ bg })`, backgroundSize:'100%'}} />

        <ParallaxLayer offset={1.3} speed={-0.3} style={{ pointerEvents: 'none' }}>

          <img src={Img} alt="truck" />
        </ParallaxLayer>



        <ParallaxLayer offset = {0.0} speed = {-0.7} style ={{opacity:0.9}}>
          <img src = {cam}  style={{ width: '15%', marginRight: '70%',position: 'absolute',  bottom: '-20px'}}/>
        </ParallaxLayer>


        <ParallaxLayer
          offset={2}
          speed={-0.3}
          style={{
            backgroundSize: '80%',
            backgroundPosition: 'center',
            backgroundImage: url('clients', true)
          }}
        />

        <ParallaxLayer
          offset={0}
          speed={0.1}
          onClick={() => this.parallax.scrollTo(1)}
          style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
          <AboutComponent />
        </ParallaxLayer>

        <ParallaxLayer
          offset={1}
          speed={0.1}
          onClick={() => this.parallax.scrollTo(2)}
          style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
          <HomeComponent />
        </ParallaxLayer>

        <ParallaxLayer
          offset={2}
          speed={-0}
          style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}
          onClick={() => this.parallax.scrollTo(3)}>
          <JoinComponent />
        </ParallaxLayer>

        <ParallaxLayer
          offset={3}
          speed={0.4}
          onClick={() => this.parallax.scrollTo(0)}
          style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
          <ContactComponent />
        </ParallaxLayer>
      </Parallax>
    )
  }
}

ReactDOM.render(<App />, document.getElementById('root'))
